BEGIN TRANSACTION;
CREATE TABLE "user" ("id" INTEGER NOT NULL PRIMARY KEY, "password" VARCHAR(255) NOT NULL, "email" VARCHAR(255) NOT NULL, "group" VARCHAR(255) NOT NULL);
CREATE TABLE "sensors" (
"sensors_room" TEXT,
  "sensors_time" TEXT,
  "sensors_rssi" TEXT,
  "sensors_audio" TEXT,
  "sensors_video" TEXT
);
CREATE TABLE "rooms" (
"room_number" TEXT,
  "room_building" TEXT,
  "room_campus" TEXT,
  "room_capacity" REAL,
  "room_occupancy_score" REAL,
  "room_rssi_baseline" REAL,
  "room_audio_baseline" REAL
);
CREATE TABLE "permissions" ("user_group" VARCHAR(255) NOT NULL PRIMARY KEY, "rules" VARCHAR(255) NOT NULL);
	"add-user": true,
	"add-truth": true,
	"add-class": false,
	"view-data": true,
	"add-logs": true
}'),
 ('user','{
	"add-truth": true,
	"view-data": true
}');
CREATE TABLE "counts" (
"counts_room_number" TEXT,
  "counts_truth_percent" TEXT,
  "counts_truth" REAL,
  "counts_module_code" TEXT,
  "counts_time" TEXT,
  "counts_associated" REAL,
  "counts_authenticated" REAL,
  "counts_truth_is_occupied" REAL,
  "counts_predicted" REAL,
  "counts_predicted_is_occupied" REAL
);
CREATE TABLE "classes" (
"classes_room_number" TEXT,
  "classes_time" TEXT,
  "classes_module_code" TEXT,
  "classes_size" REAL,
  "classes_attendance_score" REAL
);
CREATE TABLE "Allocation_Score" (
	`counts_date`	REAL,
	`counts_hour`	REAL,
	`counts_room`	TEXT,
	`counts_time`	TEXT,
	`counts_capacity`	REAL,
	`counts_truth_percent`	TEXT,
	`counts_truth`	REAL,
	`counts_module_code`	TEXT,
	`counts_size`	REAL,
	`counts_associated`	REAL,
	`counts_authenticated`	REAL,
	`room_allocation_score`	REAL,
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT
);
CREATE UNIQUE INDEX "user_email" ON "user" ("email");
CREATE UNIQUE INDEX "permissions_rules" ON "permissions" ("rules");
COMMIT;
